def solve():
    s = "t0 t26 t30 t10 t30 t32 t13 t24 t3 t5 t20 t18 t25 t10 t7 t24 t10 t30 t8 t21 t30 t20 t30 t0 t20 t7 t20 t30 t4 t27 t30 t32 t25 t3 t30 t30 t21 t20 t24 t28 t3 t5 t18 t30 t5 t23"

    if s == solve_string(s):
        print("Yes")
    else:
        print("No")

def solve_string(s):
    n = len(s)
    if n == 0:
        return "Yes"

    dp = [False] * (n + 1)
    dp[0] = True

    for i in range(1, n + 1):
        for j in range(i):
            if dp[j] and s[j:i] in s:
                dp[i] = True
                break

    return dp[n]

